import React, { Component } from 'react'

export default class Ul extends Component {
    render() {
        const {number,date,thing,name,student_number,status,address} = this.props
        return (

                <tr>
                    <td><input type="checkbox" /></td>
                    <td>{number}</td>
                    <td>{date}</td>
                    <td>{thing}</td>
                    <td>{name}</td>
                    <td>{student_number}</td>
                    <td>{status}</td>
                    <td>{address}</td>
                    <td>操作</td>
                </tr>
        )
    }
}
